import React, { useState } from 'react';
import './CSS/Knives.css';
import all_knives from '../Components/Assets/all_knifes';
import Item from '../Components/Knife/Knife';

export const Knives = () => {
    const [searchQuery, setSearchQuery] = useState('');
    const [knifeType, setKnifeType] = useState('');
    const [minPrice, setMinPrice] = useState('');
    const [maxPrice, setMaxPrice] = useState('');

    const handleKnifeTypeChange = (event) => {
        setKnifeType(event.target.value);
    };

    const handleMinPriceChange = (event) => {
        setMinPrice(event.target.value);
    };

    const handleMaxPriceChange = (event) => {
        setMaxPrice(event.target.value);
    };

    const filteredKnives = all_knives.filter((knife) => {
        const matchesSearchQuery = knife.name.toLowerCase().includes(searchQuery.toLowerCase());
        const matchesKnifeType = knifeType === '' || knife.type.toLowerCase() === knifeType.toLowerCase();
        const matchesMinPrice = minPrice === '' || knife.knife_price >= parseInt(minPrice);
        const matchesMaxPrice = maxPrice === '' || knife.knife_price <= parseInt(maxPrice);

        return matchesSearchQuery && matchesKnifeType && matchesMinPrice && matchesMaxPrice;
    });

    return (
        <div className='knives'>
            <h1>All Knives</h1>
            <input
                type="text"
                placeholder="Search for Knives..."
                className="search-bar"
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
            />
            <div className="filters">
                <select onChange={handleKnifeTypeChange} value={knifeType}>
                    <option value="">All Types</option>
                    {/* Add options for each knife type */}
                    <option value="Bayonet">Bayonet</option>
                    <option value="Bowie">Bowie</option>
                    <option value="Butterfly">Butterfly</option>
                    <option value="Classic">Classic</option>
                    <option value="Falchion">Falchion</option>
                    <option value="Flip">Flip</option>
                    <option value="Gut">Gut</option>
                    <option value="Huntsman">Huntsman</option>
                    <option value="Karambit">Karambit</option>
                    <option value="Kukri">Kukri</option>
                    <option value="M9 Bayonet">M9 Bayonet</option>
                    <option value="Navaja">Navaja</option>
                    <option value="Nomad">Nomad</option>
                    <option value="Paracord">Paracord</option>
                    <option value="Shadow">Shadow</option>
                    <option value="Skeleton">Skeleton</option>
                    <option value="Stiletto">Stiletto</option>
                    <option value="Survival">Survival</option>
                    <option value="Talon">Talon</option>
                    <option value="Ursus">Ursus</option>
                </select>
                <div className="price-filter">
                    <input
                        type="number"
                        placeholder="Min Price"
                        value={minPrice}
                        onChange={handleMinPriceChange}
                    />
                    <input
                        type="number"
                        placeholder="Max Price"
                        value={maxPrice}
                        onChange={handleMaxPriceChange}
                    />
                </div>
            </div>
            <div className='knife-grid'>
                <div className='all-knives'>
                    {filteredKnives.map((item, i) => (
                        <Item
                            key={i}
                            id={item.id}
                            name={item.name}
                            image={item.image}
                            knife_price={item.knife_price}
                        />
                    ))}
                </div>
            </div>
        </div>
    );
}

export default Knives;
